angular.module('app', ['components', 'google-maps', 'ui.date']);


if (typeof(Number.prototype.toRad) === "undefined") {
  Number.prototype.toRad = function() {
    return this * Math.PI / 180;
  }
}
var monthNames = [ "January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December" ];
function tidesController($scope) {
  var currentLocation = null, locationData = null;
  $scope.date =  new Date().getDate()+'/'+(new Date().getMonth()+1)+'/'+new Date().getFullYear();
  $scope.content = 'No location selected yet.';
  function updateContent(){
    if(locationData){
      var date = moment('d/m/yy', $scope.date);
      var day = locationData[monthNames[date.month()]+date.year()][date.date()];
      function parseTides(keys){
	var result = [];
	keys.forEach(function(key){
	  if(day[key]){
	    result.push(
	      day[key].replace('/ ', '(')+')'
	    )
	  }
	});
	return result;
      }
      $scope.lows = parseTides(['3', '5']);
      $scope.highs = parseTides(['2', '4', '6']);
    }   
   }
   $scope.dateChange = function(){
      updateContent();
   };
  
  $( "#datepicker" ).datepicker({
    minDate:new Date(2014,0,1),
    maxDate:new Date(2014,11,31),
    dateFormat: "d/m/yy",
    showOn: 'both',
    buttonImage: 'dropdown_icon.png'
    });
  var centreLatLng = {
    latitude: -25.274398,
    longitude: 133.775136
  };
  var allPoints = latlons.map(function(point){ return convert(point)});
  $scope.nearest = 'unknown';
  $scope.map = {
    center: centreLatLng,
    zoom: 3
  };
  $scope.nearestMarker = angular.extend({
    visible: false,
    draggable: false,
    icon: 'http://maps.google.com/mapfiles/ms/icons/green-dot.png'
  }, centreLatLng);
  function move(arg){
    $scope.$apply(function(){
      var lat = arg.position.d;
      var lng = arg.position.e;
      var R = 6371; // km
      function getDist(p1, index){
	  var dLat = (p1.lat-lat).toRad();
	  var dLon = (p1.lng-lng).toRad();
	  var lat1 = lat.toRad();
	  var lat2 = p1.lat.toRad();
	  
	  var a = Math.sin(dLat/2) * Math.sin(dLat/2) +
		  Math.sin(dLon/2) * Math.sin(dLon/2) * Math.cos(lat1) * Math.cos(lat2); 
	  var c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a)); 
	  var d = R * c;
	  return {
	    dist:d,
	    i:index,
	    lat: p1.lat,
	    lng: p1.lng
	  };
      }
      var nearest = allPoints.map(getDist).sort(function(p1,p2){return p1.dist-p2.dist})[0];
      $scope.nearest = places[latlons[nearest.i]];
      $scope.nearestMarker.latitude = nearest.lat;
      $scope.nearestMarker.visible = true;
      $scope.nearestMarker.longitude = nearest.lng;
      if (currentLocation != latlons[nearest.i]){
	$.getJSON('data/'+latlons[nearest.i]+'.json', function(data){
	  locationData = data;
	  updateContent();
	});
      }
      currentLocation = latlons[nearest.i];
    });
  }
  $scope.marker = angular.extend({
	draggable: true,
	title:"Find tide times at this location",
	drag: move
    }, centreLatLng);
   //HTML5 geolocation - zoom to user's location
  if(navigator.geolocation) {
    navigator.geolocation.getCurrentPosition(function(position) {
      centreLatLng = {
	latitude: position.coords.latitude,
	longitude: position.coords.longitude
      };
      $scope.map.center = centreLatLng;
      $scope.map.zoom = 5;
      $scope.marker.latitude = centreLatLng.latitude;
      $scope.marker.longitude = centreLatLng.longitude;
      move({
	position:{
	  d:centreLatLng.latitude,
	  e: position.coords.longitude
	}
      });
    }, function(){
      //error getting location, just use default
    });
  }
  
}

